import React from "react"
import DropFileInput from "../components/drop-file-input/DropFileInput"
import "./home.css"
export default class Home extends React.Component{

  uploadFiles = (files) =>{
    console.log(files)
  }
  render(){
    return(
      <div className="box">
        <h2 className="header">
          Input Files
        </h2>
        <DropFileInput uploadFiles={this.uploadFiles}/>
      </div>
    )
  }
}
